import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    this.state = {
      allListings: [],
      activeFilters: "",
    };
  }

  componentDidMount() {
    fetch();
  }

  render() {
    return (
      <div className='App'>
        <header className='App-header'>
          <h1>Static Job Listings Site</h1>
        </header>
        <main className='App-main'>
          <Filterbox />
          <AllListings />
        </main>
      </div>
    );
  }
}

export default App;
